import App from "../App";
import "./TileArea.css";
import User from "./User";
import UserJob from "./UserJob";
import UserHobby from "./UserHobby";

function TileArea(props) {
  return (
    <div className="eachTile">
      <User name={props.name} />
      <UserJob job={props.job} />
      <UserHobby hobby={props.hobby} />

      <div className="tile">
        <TileArea
          name={props.item[0].name}
          job={props.item[0].job}
          hobby={props.item[0].hobby}
        />
        <TileArea
          name={props.item[1].name}
          job={props.item[1].job}
          hobby={props.item[1].hobby}
